export class FloodAnalysis {
    _coverageArea: any[]; /** 淹没分析覆盖区域 */
    _currentHeight: number; /** 当前淹没高度 */
    _floodSpeed: number; /** 淹没速度 */
    _maxVisibleValue: number; /** 最大淹没高度 */
    _minVisibleValue: number; /** 最小淹没高度 */
    _flooding: boolean;
    _dataSource: any;
    _enabled: boolean;
    _color: string;
    _opacity: number;
    afterAddToEngine(engine: any): void;
    _engine: any;
    /**
     * 淹没回调
     * 用于支持polygon拉伸和分层设色两种方式
     */
    floodCallback(): void;
    _floodPolygon: any;
    _startFlood: () => void;
    distroy(): void;
    set color(arg: string);
    get color(): string;
    set opacity(arg: number);
    get opacity(): number;
    set dataSource(arg: any);
    get dataSource(): any;
    set maxVisibleValue(arg: number);
    get maxVisibleValue(): number;
    set minVisibleValue(arg: number);
    get minVisibleValue(): number;
    set floodSpeed(arg: number);
    get floodSpeed(): number;
    set enabled(arg: boolean);
    get enabled(): boolean;
}
